import React from 'react';



const NavBar = () => {

    return (
        <div>

            <nav class="db dt-l w-100 border-box pa3 ph5-l">
  <p class="db dtc-l v-mid mid-gray link dim w-100 w-25-l tc tl-l mb2 mb0-l" href="#" title="Home">
    <img src="http://tachyons.io/img/logo.jpg" class="dib w2 h2 br-100" alt="Site Name"/>
  </p>
  <div class="db dtc-l v-mid w-100 w-75-l tc tr-l">
    <p class="link dim dark-gray f6 f5-l dib mr3 mr4-l pointer"  title="Home">About Me</p>
    <p class="link dim dark-gray f6 f5-l dib mr3 mr4-l pointer" title="How it Works">Skills</p>
    <p class="link dim dark-gray f6 f5-l dib mr3 mr4-l pointer" title="Blog">Education</p>
    <p class="link dim dark-gray f6 f5-l dib mr3 mr4-l pointer"  title="Press">Projects</p>
    <p class="link dim dark-gray f6 f5-l dib pointer"  title="Contact">Contact Information</p>
  </div>
</nav>
        </div>
    )
}

export default NavBar;
